import Head from "next/head";
import styles from "../styles/Home.module.css";
import Monopoly from "../assets/monopoly";
import { useState } from "react";

const DiceButton = () => {
  const [val, setVal] = useState(6);
  return (
    <button
      onClick={() => {
        // lol not acc
        setVal(Math.floor(Math.random() * 12) + 1);
        console.log("rolled", val);
      }}
    >
      Roll Dice ({val})
    </button>
  );
};

export default function Home() {
  let { properties, tiles, chance, communitychest } = Monopoly;
  console.log(properties);
  return (
    <div className={styles.container}>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main className={styles.main}>
        <h1 className={styles.title}>Monopoly</h1>

        <p className={styles.description}>
          Roll Dice
          <DiceButton />
        </p>

        <div className={styles.grid}>
          {tiles
            .map((t) => properties.filter((p) => p.id == t.id))
            // .sort((a, b) => a.position - b.position)
            .map((p) => (
              <>
                <div className={styles.card}>{JSON.stringify(p)}</div>
                <button>buy</button>
                <button></button>
              </>
            ))}
        </div>
      </main>

      <footer className={styles.footer}>
        <a
          href="https://vercel.com?utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
          target="_blank"
          rel="noopener noreferrer"
        >
          Powered by{" "}
          <img src="/vercel.svg" alt="Vercel Logo" className={styles.logo} />
        </a>
      </footer>
    </div>
  );
}
